import axios from 'axios';

const LoginService = {
    login: async function(username, passwrord) {
        const response = await axios.post(
            'http://localhost/testsite/wp-json/jwt-auth/v1/token',
            {
                username: 'jcewinski@stardust-americana.com',
                passwrord: '!NQOG1t$gCwH@'
            }
        );
        
        console.log(response);
    }
};

export default LoginService;
